import React from 'react'
import StoryMetadataBtn from './StoryMetadataBtn'

const StoryFilter = props => {
  const { filterTags, toggleFilter } = props
  return (
    <div>
      <div className='website-tags'>
        {
          filterTags.websites.map((website, index) => {
            return <StoryMetadataBtn
              website={website}
              key={index}
              toggleFilter={toggleFilter}
            />
          })
        }

      </div>
      <div className='category-tags'>
        {
          filterTags.categories.map((category, index) => {
            return <StoryMetadataBtn
              category={category}
              key={index}
              toggleFilter={toggleFilter}
            />
          })
        }
      </div>
    </div>
  )
}

export default StoryFilter
